description:
They Call Us Misfits Trilogy, Complete  (Modstrilogin)

The film is an uncompromising account of the life of two alienated teenagers. The film takes a close but non-moralizing look at the joys and growing pains of mod and 'junkie' street culture in Stockholm at the time

IMDB: 7.9


There are 3 parts_

1. They Call Us Misfits, 1968.avi
2. A Decent Life, 1979.avi
3. Misfits To Yuppies, 1993.avi


